export default class App extends Component {
  render() {

    return (
        <Router>


        {/* <div style={{ overflowX: 'hidden' }}> */}
          <Main/>
          <Switch>

          <Route exact path='/' component={Main}/>
          <Route path='/home' component = {Home}/>
          </Switch>

        {/* </div> */}
        </Router>
    );
  }
}
